import React from 'react'
import PropTypes from 'prop-types'

import styles from './addgarmenttooutfitform.module.css'

export class AddGarmentToOutfitForm extends React.Component {
  static propTypes = {
    capsuleID: PropTypes.string,
    garmentID: PropTypes.string,
    onClick: PropTypes.func
  }

  render() {
    return (
      <div className={styles.form}>
        <button onClick={() => this.props.onClick(this.props.garmentID)}>Add to Outfit</button>
      </div>
    )
  }
}

export default AddGarmentToOutfitForm
